DROP TRIGGER IF EXISTS `COMMENT_OPTION_TRIG`;
DELIMITER ;;
CREATE TRIGGER `COMMENT_OPTION_TRIG` BEFORE INSERT ON `COMMENT_OPTION` FOR EACH ROW begin 
   DECLARE NCOID INT;
   SELECT CASE WHEN NEW.COPID=-1 THEN 0 ELSE IFNULL(MAX(COID),0)+1 END INTO NCOID FROM COMMENT_OPTION WHERE COPID = NEW.COPID;
   SET NEW.COID = NCOID;
end
;;
DELIMITER ;
